script: |
  super -f text -I q6205.spq | sort > q6205.out

inputs:
  - name: q6205.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT col0 * - 19 + - ( - col0 ) BETWEEN + col2 * + col0 + - + col0 AND - + col2 - col2 * - col2;
  - name: tab0

outputs:
  - name: q6205.out
    data: |
      15	81	47
      87	21	10
      97	1	99
